INSERT INTO `bt_danye` (`id`, `content`, `time`, `title`) VALUES
(1, '&lt;h4&gt;\r\n		公司介绍	&lt;/h4&gt;&lt;p&gt;\r\n		华为是全球领先的信息与通信解决方案供应商。我们围绕客户的需求持续创新，与合作伙伴开\r\n放合作，在电信网络、企业网络、消费者和云计算等领域构筑了端到端的解决方案优势。我们致力于为电信运营商、企业和消费者等提供有竞争力的 ICT \r\n解决方案和服务，持续提升客户体验，为客户创造最大价值。目前，华为的产品和解决方案已经应用于 140 多个国家，服务全球 1/3的人口。	&lt;/p&gt;&lt;p&gt;\r\n		我们以丰富人们的沟通和生活为愿景，运用信息与通信领域专业经验，消除数字鸿沟，让人人享有宽带。为应对全球气候变化挑战，华为通过领先的绿色解决方案，帮助客户及其他行业降低能源消耗和二氧化碳排放，创造最佳的社会、经济和环境效益。	&lt;/p&gt;&lt;h4&gt;\r\n		愿景使命	&lt;/h4&gt;&lt;p&gt;&lt;strong&gt;愿景&lt;/strong&gt; \r\n	&lt;/p&gt;&lt;p&gt;\r\n		丰富人们的沟通和生活。	&lt;/p&gt;&lt;p&gt;&lt;strong&gt;使命&lt;/strong&gt; \r\n	&lt;/p&gt;&lt;p&gt;\r\n		聚焦客户关注的挑战和压力，提供有竞争力的通信与信息解决方案和服务，持续为客户创造最大价值。	&lt;/p&gt;&lt;p&gt;&lt;strong&gt;核心价值观&lt;/strong&gt; \r\n	&lt;/p&gt;&lt;p&gt;\r\n		公司核心价值观是扎根于我们内心深处的核心信念，是华为走到今天的内在动力，更是我们面向未来的共同承诺。它确保我们步调一致地为客户提供有效的服务，实现&amp;quot;丰富人们的沟通和生活&amp;quot;的愿景。	&lt;/p&gt;&lt;p style=&quot;text-align:center;&quot;&gt;&lt;img src=&quot;http://res.vmall.com/20141029/images/help/company01.jpg&quot; alt=&quot;华为愿景图&quot; width=&quot;331&quot; height=&quot;329&quot;/&gt; \r\n	&lt;/p&gt;&lt;p&gt;&lt;strong&gt;成就客户&lt;/strong&gt; \r\n	&lt;/p&gt;&lt;p&gt;\r\n		为客户服务是华为存在的唯一理由，客户需求是华为发展的原动力。我们坚持以客户为中心，快速响应客户需求，持续为客户创造长期价值进而成就客户。为客户提供有效服务，是我们工作的方向和价值评价的标尺，成就客户就是成就我们自己。	&lt;/p&gt;&lt;p&gt;&lt;strong&gt;艰苦奋斗&lt;/strong&gt; \r\n	&lt;/p&gt;&lt;p&gt;\r\n		我们没有任何稀缺的资源可以依赖，唯有艰苦奋斗才能赢得客户的尊重与信赖。奋斗体现在为客户创造价值的任何微小活动中，以及在劳动的准备过程中为充实提高自己而做的努力。我们坚持以奋斗者为本，使奋斗者得到合理的回报。	&lt;/p&gt;&lt;p&gt;&lt;strong&gt;自我批判&lt;/strong&gt; \r\n	&lt;/p&gt;&lt;p&gt;\r\n		自我批判的目的是不断进步，不断改进，而不是自我否定。只有坚持自我批判，才能倾听、扬弃和持续超越，才能更容易尊重他人和与他人合作，实现客户、公司、团队和个人的共同发展。	&lt;/p&gt;&lt;p&gt;&lt;strong&gt;开放进取&lt;/strong&gt; \r\n	&lt;/p&gt;&lt;p&gt;\r\n		为了更好地满足客户需求，我们积极进取、勇于开拓，坚持开放与创新。任何先进的技术、产品、解决方案和业务管理，只有转化为商业成功才能产生价值。我们坚持客户需求导向，并围绕客户需求持续创新。	&lt;/p&gt;&lt;p&gt;&lt;strong&gt;至诚守信&lt;/strong&gt; \r\n	&lt;/p&gt;&lt;p&gt;\r\n		我们只有内心坦荡诚恳，才能言出必行，信守承诺。诚信是我们最重要的无形资产，华为坚持以诚信赢得客户。	&lt;/p&gt;&lt;p&gt;&lt;strong&gt;团队合作&lt;/strong&gt; \r\n	&lt;/p&gt;&lt;p&gt;\r\n		胜则举杯相庆，败则拼死相救。团队合作不仅是跨文化的群体协作精神，也是打破部门墙、提升流程效率的有力保障。	&lt;/p&gt;&lt;h4&gt;\r\n		发展历程	&lt;/h4&gt;&lt;p&gt;&lt;strong&gt;2011年&lt;/strong&gt; \r\n	&lt;/p&gt;&lt;ul class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;\r\n			发布GigaSite解决方案和泛在超宽带网络架构 U2Net。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			建设了20个云计算数据中心。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			华为智能手机销售量达到2000 万部。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			以5.3亿美元收购华赛。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			整合成立了&amp;quot;2012 实验室&amp;quot;。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			发布HUAWEI SmartCare 解决方案。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			在全球范围内囊获6大LTE顶级奖项。		&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;2010年&lt;/strong&gt; \r\n	&lt;/p&gt;&lt;ul class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;\r\n			全球部署超过80个SingleRAN商用网络，其中28个已商用发布或即将发布LTE/EPC业务。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			在英国成立安全认证中心。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			与中国工业和信息化部签署节能自愿协议。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			加入联合国世界宽带委员会。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			获英国《经济学人》杂志2010年度公司创新大奖。		&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;2009年&lt;/strong&gt; \r\n	&lt;/p&gt;&lt;ul class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;\r\n			无线接入市场份额跻身全球第二。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			成功交付全球首个LTE/EPC商用网络，获得的LTE商用合同数居全球首位。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			率先发布从路由器到传输系统的端到端100G解决方案。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			获得IEEE标准组织2009年度杰出公司贡献奖。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			获英国《金融时报》颁发的&amp;quot;业务新锐奖&amp;quot;，并入选美国Fast Company杂志评选的最具创新力公司前五强。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			主要产品都实现资源消耗同比降低20%以上，在全球部署了3000多个新能源供电解决方案站点。		&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;2008年&lt;/strong&gt; \r\n	&lt;/p&gt;&lt;ul class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;\r\n			被商业周刊评为全球十大最有影响力的公司。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			根据Informa的咨询报告，华为在移动设备市场领域排名全球第三。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			首次在北美大规模商用UMTS/HSPA网络，为加拿大运营商Telus和Bell建设下一代无线网络。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			移动宽带产品全球累计发货量超过2000万部，根据ABI的数据，市场份额位列全球第一。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			全年共递交1737件PCT专利申请，据世界知识产权组织统计，在2008年专利申请公司(人)排名榜上排名第一；LTE专利数占全球10%以上。		&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;2007年&lt;/strong&gt; \r\n	&lt;/p&gt;&lt;ul class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;\r\n			与赛门铁克合作成立合资公司，开发存储和安全产品与解决方案。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			与Global Marine合作成立合资公司，提供海缆端到端网络解决方案。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			在2007年底成为欧洲所有顶级运营商的合作伙伴。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			被沃达丰授予&amp;quot;2007杰出表现奖&amp;quot;，是唯一获此奖项的电信网络解决方案供应商。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			推出基于全IP网络的移动固定融合（FMC）解决方案战略，帮助电信运营商节省运作总成本，减少能源消耗。		&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;2006年&lt;/strong&gt; \r\n	&lt;/p&gt;&lt;ul class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;\r\n			以8.8亿美元的价格出售H3C公司49%的股份。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			与摩托罗拉合作在上海成立联合研发中心，开发UMTS技术。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			推出新的企业标识，新标识充分体现了我们聚焦客户、创新、稳健增长和和谐的精神。		&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;2005年&lt;/strong&gt; \r\n	&lt;/p&gt;&lt;ul class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;\r\n			海外合同销售额首次超过国内合同销售额。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			与沃达丰签署《全球框架协议》，正式成为沃达丰优选通信设备供应商。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			成为英国电信（简称BT）首选的21世纪网络供应商，为BT21世纪网络提供多业务网络接入(MSAN)部件和传输设备。		&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;2004年&lt;/strong&gt; \r\n	&lt;/p&gt;&lt;ul class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;\r\n			与西门子合作成立合资公司，开发TD-SCDMA解决方案。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			获得荷兰运营商Telfort价值超过2500万美元的合同，首次实现在欧洲的重大突破。		&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;2003年&lt;/strong&gt; \r\n	&lt;/p&gt;&lt;ul class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;\r\n			与3Com合作成立合资公司，专注于企业数据网络解决方案的研究。		&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;2002年&lt;/strong&gt; \r\n	&lt;/p&gt;&lt;ul class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;\r\n			海外市场销售额达5.52亿美元。		&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;2001年&lt;/strong&gt; \r\n	&lt;/p&gt;&lt;ul class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;\r\n			以7.5亿美元的价格将非核心子公司Avansys卖给爱默生。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			在美国设立四个研发中心。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			加入国际电信联盟（ITU）。		&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;2000年&lt;/strong&gt; \r\n	&lt;/p&gt;&lt;ul class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;\r\n			在瑞典首都斯德哥尔摩设立研发中心。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			海外市场销售额达1亿美元。		&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;1999年&lt;/strong&gt; \r\n	&lt;/p&gt;&lt;ul class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;\r\n			推出无线GSM解决方案。		&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;\r\n			于1998年将市场拓展到中国主要城市。		&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;1995年&lt;/strong&gt; \r\n	&lt;/p&gt;&lt;ul class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;\r\n			销售额达15亿人民币，主要来自中国农村市场。		&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;1992年&lt;/strong&gt; \r\n	&lt;/p&gt;&lt;ul class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;\r\n			开始研发并推出农村数字交换解决方案。		&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;1990年&lt;/strong&gt; \r\n	&lt;/p&gt;&lt;ul class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;\r\n			开始自主研发面向酒店与小企业的PBX技术并进行商用。		&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;1987年&lt;/strong&gt; \r\n	&lt;/p&gt;&lt;ul class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;\r\n			创立于深圳，成为一家生产用户交换机（PBX）的香港公司的销售代理。&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/ueditor/php/upload/image/20190103/1546493410676330.jpg&quot; title=&quot;1546493410676330.jpg&quot; alt=&quot;about-01.jpg&quot;/&gt;&lt;/p&gt;', 1546493423, '功能介绍'),
(2, '&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;网站名称：叁陆伍种植园&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;网站域名：www.365manor.com&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;网站客服电话：4008202365&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;公司地址：上海市杨浦区杨树浦路2300号A701室&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;邮箱：912365365@qq.com&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', 1545961212, '软件许可及服务协议'),
(4, '&lt;p&gt;\r\n	&lt;strong&gt;快捷支付&lt;/strong&gt;\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-family:宋体;&quot;&gt;持卡人只要拥有银行卡（信用卡或借记卡），无需开通即可使用，使用时输入相应卡片信息、以及身份信息等信息并验证成功，即可完成支付。&lt;/span&gt;\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;选择快捷方式：&lt;/span&gt;&lt;/b&gt;\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;br /&gt;\r\n&lt;img src=&quot;http://res.vmall.com/pimages/sale/2015-06/20150618153928736.png&quot; title=&quot;1.png&quot; /&gt;\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;b&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;选择银行卡后进入银行页面，输入相关个人信息：&lt;/span&gt;&lt;/b&gt;\r\n&lt;/p&gt;\r\n&lt;img src=&quot;http://res.vmall.com/pimages/sale/2015-06/2015061815401855.png&quot; title=&quot;2.png&quot; /&gt;', 1545961212, '战略愿景');
INSERT INTO `bt_danye` (`id`, `content`, `time`, `title`) VALUES
