t;/span&gt; &amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top:6px;margin-right:0;margin-bottom:0;margin-left:8px;margin-bottom:0&quot;&gt;Usage Data&lt;/p&gt;&lt;p style=&quot;margin-top:1px;margin-right:0;margin-bottom: 0;margin-left:0;margin-bottom:0&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size:45px&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;margin-top:0;margin-right:29px;margin-bottom: 0;margin-left:8px;margin-bottom:0&quot;&gt;When you access the Service with a mobile device, we may collect certain information automatically, including, but not limited to, the type of mobile device you use, your mobile device unique ID, the IP address of your mobile device, your mobile operating system, the type of mobile Internet browser you use, unique device identifiers and other diagnostic data (&amp;quot;Usage Data&amp;quot;).&lt;/p&gt;&lt;p style=&quot;margin-top:1px;margin-right:0;margin-bottom: 0;margin-left:0;margin-bottom:0&quot;&gt;&lt;span style=&quot;font-size: 47px&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left:8px&quot;&gt;Location Data&lt;/p&gt;&lt;p style=&quot;margin-top:1px;margin-right:0;margin-bottom: 0;margin-left:0;margin-bottom:0&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size:45px&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;margin-top:0;margin-right:28px;margin-bottom: 0;margin-left:8px;margin-bottom:0&quot;&gt;We may use and store information about your location if you give us permission to do so (&amp;quot;Location Data&amp;quot;). We use this data to provide features of our Service, to&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:15px;font-family:&amp;#39;DejaVu Sans&amp;#39;,&amp;#39;sans-serif&amp;#39;&quot;&gt;&lt;br clear=&quot;all&quot; style=&quot;page-break-before:always&quot;/&gt; &lt;/span&gt; &amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-right:173px&quot;&gt;improve and customise our Service.&lt;/p&gt;&lt;p style=&quot;margin-top:40px;margin-right:29px;margin-bottom: 0;margin-left:8px;margin-bottom:0;text-align:justify;text-justify: inter-ideograph&quot;&gt;You can enable or disable location services when you use our Service at any time by way of your device settings.&lt;/p&gt;&lt;p style=&quot;margin-top:0;margin-right:0;margin-bottom: 0;margin-left:0;margin-bottom:0&quot;&gt;&lt;span style=&quot;font-size: 46px&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left:8px&quot;&gt;Tracking&amp;nbsp;&amp;nbsp;&amp;nbsp; &amp;amp;&amp;nbsp; Cookies Data&lt;/p&gt;&lt;p style=&quot;margin-top:1px;margin-right:0;margin-bottom: 0;margin-left:0;margin-bottom:0&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size:45px&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;margin-top:0;margin-right:45px;margin-bottom: 0;margin-left:8px;margin-bottom:0&quot;&gt;We use cookies and similar tracking technologies to track the activity on our Service and we hold certain information.&lt;/p&gt;&lt;p style=&quot;margin-top:41px;margin-right:26px;margin-bottom: 0;margin-left:8px;margin-bottom:0&quot;&gt;Cookies are files with a small amount of data which may include an anonymous unique identifier.&lt;/p&gt;&lt;p style=&quot;margin-top:0;margin-right:21px;margin-bottom: 0;margin-left:8px;margin-bottom:0&quot;&gt;Cookies are sent to your browser from a website and stored on your device. Other tracking technologies are also used such as&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:15px;font-family:&amp;#39;DejaVu Sans&amp;#39;,&amp;#39;sans-serif&amp;#39;&quot;&gt;&lt;br clear=&quot;all&quot; style=&quot;page-break-before:always&quot;/&gt; &lt;/span&gt; &amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-right:56px&quot;&gt;beacons, tags and scripts to collect and track information and to improve and analyse our Service.&lt;/p&gt;&lt;p style=&quot;margin-top:41px;margin-right:68px;margin-bottom: 0;margin-left:8px;margin-bottom:0&quot;&gt;You can instruct your browser to refuse all cookies