/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:15px;font-family:&amp;#39;DejaVu Sans&amp;#39;,&amp;#39;sans-serif&amp;#39;&quot;&gt;&lt;br clear=&quot;all&quot; style=&quot;page-break-before:always&quot;/&gt; &lt;/span&gt; &amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top:6px&quot;&gt;Security of Data&lt;/p&gt;&lt;p style=&quot;margin-top:50px;margin-right:18px;margin-bottom: 0;margin-left:8px;margin-bottom:0&quot;&gt;The security of your data is important to us but remember that no method of transmission over the Internet or method of electronic storage is 100% secure. While we strive to use commercially acceptable means to protect your Personal Data, we cannot guarantee its absolute security.&lt;/p&gt;&lt;p style=&quot;margin-top:0;margin-right:0;margin-bottom: 0;margin-left:0;margin-bottom:0&quot;&gt;&lt;span style=&quot;font-size: 44px&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-right:44px&quot;&gt;Our Policy on &amp;quot;Do Not Track&amp;quot; Signals under the&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;span style=&quot;letter-spacing:-0&quot;&gt;California &lt;/span&gt;Online&amp;nbsp;&amp;nbsp; Protection Act (CalOPPA)&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:15px;font-family:&amp;#39;DejaVu Sans&amp;#39;,&amp;#39;sans-serif&amp;#39;&quot;&gt;&lt;br clear=&quot;all&quot; style=&quot;page-break-before:always&quot;/&gt; &lt;/span&gt; &amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-right:76px&quot;&gt;We do not support Do Not Track (&amp;quot;DNT&amp;quot;). Do Not Track is a preference you can set in your web browser to inform websites that you do not want to be tracked.&lt;/p&gt;&lt;p style=&quot;margin-top:41px;margin-right:54px;margin-bottom: 0;margin-left:8px;margin-bottom:0&quot;&gt;You can enable or disable Do Not Track by visiting the Preferences or Settings page of your web browser.&lt;/p&gt;&lt;p style=&quot;margin-top:1px;margin-right:0;margin-bottom: 0;margin-left:0;margin-bottom:0&quot;&gt;&lt;span style=&quot;font-size: 43px&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;Service&amp;nbsp;&amp;nbsp; Providers&lt;/p&gt;&lt;p style=&quot;margin-top:50px;margin-right:23px;margin-bottom: 0;margin-left:8px;margin-bottom:0&quot;&gt;We may employ third party companies and individuals to facilitate our Service (&amp;quot;Service Providers&amp;quot;), provide the Service on our behalf, perform Service- related services or assist us in analysing how our Service is used.&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:15px;font-family:&amp;#39;DejaVu Sans&amp;#39;,&amp;#39;sans-serif&amp;#39;&quot;&gt;&lt;br clear=&quot;all&quot; style=&quot;page-break-before:always&quot;/&gt; &lt;/span&gt; &amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-right:16px&quot;&gt;These third parties have access to your Personal Data only to perform these tasks on our behalf and are obligated not to disclose or use it for any other purpose.&lt;/p&gt;&lt;p style=&quot;margin-top:0;margin-right:0;margin-bottom: 0;margin-left:0;margin-bottom:0&quot;&gt;&lt;span style=&quot;font-size: 41px&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top:0&quot;&gt;Analytics&lt;/p&gt;&lt;p style=&quot;margin-top:47px;margin-right:57px;margin-bottom: 0;margin-left:8px;margin-bottom:0&quot;&gt;We may use third-party Service Providers to monitor and analyse the use of our Service.&lt;/p&gt;&lt;p style=&quot;margin-top:40px&quot;&gt;&lt;span style=&quot;;position: absolute;z-index:26;left:0px;margin-left:47px;margin-top:59px;width:13px;height:13px&quot;&gt;&lt;img width=&quot;13&quot; height=&quot;13&quot; src=&quot;http://weituoceshi2019.cl687.4everdns.com/Public/lib/ueditor/1.4.3/themes/default/images/spacer.gif&quot; word_img=&quot;file:///C:/Users/ADMINI~1/AppData/Local/Temp/msohtmlclip1/01/clip_image005.gif&quot; style=&quot;background:url(http://weituoceshi2019.cl687.4everdns.com/Public/lib/ueditor/1.4.3/themes/default/images/word.gif) no-repeat center center;border:1px solid #ddd&quot;/&gt;&lt;/span&gt;Google Analytics&lt;/p&gt;&lt;p style=&quot;margin-top:40px;margin-right:24px;margin-bottom: 0;margin-left:38px;margin-bottom:0&quot;&gt;Google Analytics is a web analytics service offered by Google that tracks and reports website traffic. Google uses the data collected to track and monitor the use of our Service. This data is shared with other Google services. Google may use&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:15px;font-family:&amp;#39;DejaVu Sans&amp;#39;,&amp;#39;sans-serif&amp;#39;&quot;&gt;&lt;br clear=&quot;all&quot; style=&quot;page-break-before:always&quot;/&gt; &lt;/span&gt; &amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top:6px;margin-right:93px;margin-bottom: 0;margin-left:38px;margin-bottom:0&quot;&gt;the collected data to contextualise and personalise the ads of its own advertising network.&lt;/p&gt;&lt;p style=&quot;margin-top:41px;margin-right:16px;margin-bottom: 0;margin-left:38px;margin-bottom:0&quot;&gt;You may opt-out of certain Google Analytics features through your mobile device settings, such as your device advertising settings or by following the instructions provided by Google in their Privacy Policy: &lt;a href=&quot;https://policies.google.com/privacy?hl=en&quot;&gt;&lt;span style=&quot;color:#0000ED;letter-spacing:-0&quot;&gt;https://policies.google.com/privac&lt;/span&gt; &lt;span style=&quot;color:#0000ED&quot;&gt;hl=en&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;margin-top:42px;margin-right:16px;margin-bottom: 0;margin-left:38px;margin-bottom:0&quot;&gt;For more information on the privacy practices of Google, please visit the Google Privacy &amp;amp; Terms web page: &lt;a href=&quot;https://policies.google.com/privacy?hl=en&quot;&gt;&lt;span style=&quot;color:#0000ED;letter-spacing:-0&quot;&gt;https://policies.google.com/privac&lt;/span&gt; &lt;span style=&quot;color:#0000ED&quot;&gt;hl=en&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:15px;font-family:&amp;#39;DejaVu Sans&amp;#39;,&amp;#39;sans-serif&amp;#39;&quot;&gt;&lt;br clear=&quot;all&quot; style=&quot;page-break-before:always&quot;/&gt; &lt;/span&gt; &amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top:6px&quot;&gt;Advertising&lt;/p&gt;&lt;p style=&quot;margin-top:47px;margin-right:41px;margin-bottom: 0;margin-left:8px;margin-bottom:0&quot;&gt;We may use third-party Service Providers to show advertisements to you to help support and maintain our Service.&lt;/p&gt;&lt;p style=&quot;margin-top:41px;margin-right:260px;margin-bottom: 0;margin-left:38px;margin-bottom:0&quot;&gt;&lt;span style=&quot;;position: absolute;z-index:27;left:0px;margin-left:47px;margin-top:59px;width:13px;height:13px&quot;&gt;&lt;img width=&quot;13&quot; height=&quot;13&quot; src=&quot;http://weituoceshi2019.cl687.4everdns.com/Public/lib/ueditor/1.4.3/themes/default/images/spacer.gif&quot; word_img=&quot;file:///C:/Users/ADMINI~1/AppData/Local/Temp/msohtmlclip1/01/clip_image014.gif&quot; style=&quot;background:url(http://weituoceshi2019.cl687.4everdns.com/Public/lib/ueditor/1.4.3/themes/default/images/word.gif) no-repeat center center;border:1px solid #ddd&quot;/&gt;&lt;/span&gt;Google AdSense &amp;amp; DoubleClick Cookie&lt;/p&gt;&lt;p style=&quot;margin-top:40px;margin-right:36px;margin-bottom: 0;margin-left:38px;margin-bottom:0&quot;&gt;Google, as a third party vendor, uses cookies to serve ads on our Service. Google&amp;#39;s use of the DoubleClick cookie enables it and its partners to serve ads to our users based on their visit to our Service or other websites on the Internet.&lt;/p&gt;&lt;p style=&quot;margin-top:41px;margin-right:18px;margin-bottom: 0;margin-left:38px;margin-bottom:0&quot;&gt;You may opt out of the use of the DoubleClick Cookie for interest- based advertising by visiting the&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:15px;font-family:&amp;#39;DejaVu Sans&amp;#39;,&amp;#39;sans-serif&amp;#39;&quot;&gt;&lt;br clear=&quot;all&quot; style=&quot;page-break-before:always&quot;/&gt; &lt;/span&gt; &amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top:6px;margin-right:5px;margin-bottom: 0;margin-left:38px;margin-bottom:0&quot;&gt;Google Ads Settings web page: &lt;a href=&quot;http://www.google.com/ads/preferences/&quot;&gt;&lt;span style=&quot;color:#0000ED&quot;&gt;http://www.google.com/ads/prefer&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;margin-top:1px;margin-right:0;margin-bottom: 0;margin-left:0;margin-bottom:0&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Behavioral Remarketing&lt;/p&gt;&lt;p style=&quot;margin-top:47px;margin-right:17px;margin-bottom: 0;margin-left:8px;margin-bottom:0&quot;&gt;MEETBA L.L.C. uses remarketing services to advertise on third party websites to you after you visited our Service. We and our third- party vendors use cookies to inform, optimise and serve ads based on your past visits to our Service.&lt;/p&gt;&lt;p style=&quot;margin-top:41px&quot;&gt;&lt;span style=&quot;;position: absolute;z-index:28;left:0px;margin-left:47px;margin-top:60px;width:13px;height:13px&quot;&gt;&lt;img width=&quot;13&quot; height=&quot;13&quot; src=&quot;http://weituoceshi2019.cl687.4everdns.com/Public/lib/ueditor/1.4.3/themes/default/images/spacer.gif&quot; word_img=&quot;file:///C:/Users/ADMINI~1/AppData/Local/Temp/msohtmlclip1/01/clip_image014.gif&quot; style=&quot;background:url(http://weituoceshi2019.cl687.4everdns.com/Public/lib/ueditor/1.4.3/themes/default/images/word.gif) no-repeat center center;border:1px solid #ddd&quot;/&gt;&lt;/span&gt;Google Ads (AdWords)&lt;/p&gt;&lt;p style=&quot;margin-top:40px;margin-right:56px;margin-bottom: 0;margin-left:38px;margin-bottom:0&quot;&gt;Google Ads (AdWords) remarketing service is provided by Google Inc.&lt;/p&gt;&lt;p style=&quot;margin-top:41px;margin-right:43px;margin-bottom: 0;margin-left:38px;margin-bottom:0&quot;&gt;You can opt-out of Google Analytics for Display Advertising&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:15px;font-family:&amp;#39;DejaVu Sans&amp;#39;,&amp;#39;sans-serif&amp;#39;&quot;&gt;&lt;br clear=&quot;all&quot; style=&quot;page-break-before:always&quot;/&gt; &lt;/span&gt; &amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top:6px;margin-right:15px;margin-bottom: 0;margin-left:38px;margin-bottom:0&quot;&gt;and customise the Google Display Network ads by visiting the Google Ads Settings page: &lt;a href=&quot;http://www.google.com/settings/ads&quot;&gt;&lt;span style=&quot;color:#0000ED;letter-spacing:-0&quot;&gt;http://www.google.com/settings/a&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;margin-top:41px;margin-right:18px;margin-bottom: 0;margin-left:38px;margin-bottom:0&quot;&gt;Google also recommends installing the Google Analytics Opt-out Browser Add-on - &lt;a href=&quot;https://tools.google.com/dlpage/gaoptout&quot;&gt;&lt;span style=&quot;color:#0000ED&quot;&gt;https://tools.google.com/dlpage/g&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;margin-top:1px;margin-right:32px;margin-bottom: 0;margin-left:38px;margin-bottom:0&quot;&gt;- for your web browser. Google Analytics Opt-out Browser Add- on provides visitors with the ability to prevent their data from being collected and used by Google Analytics.&lt;/p&gt;&lt;p style=&quot;margin-top:41px;margin-right:15px;margin-bottom: 0;margin-left:38px;margin-bottom:0&quot;&gt;For more information on the privacy practices of Google, please visit the Google Privacy &amp;amp; Terms web page: &lt;a href=&quot;https://policies.google.com/privacy?hl=en&quot;&gt;&lt;span style=&quot;color:#0000ED&quot;&gt;https://policies.google.com/privac&lt;/span&gt; &lt;span style=&quot;color:#0000ED&quot;&gt;hl=en&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:15px;font-family:&amp;#39;DejaVu Sans&amp;#39;,&amp;#39;sans-serif&amp;#39;&quot;&gt;&lt;br clear=&quot;all&quot; style=&quot;page-break-before:always&quot;/&gt; &lt;/span&gt; &amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top:6px&quot;&gt;Links&amp;nbsp; to&amp;nbsp; Other Sites&lt;/p&gt;&lt;p style=&quot;margin-top:50px;margin-right:65px;margin-bottom: 0;margin-left:8px;margin-bottom:0&quot;&gt;Our Service may contain links to other sites that are not operated by us. If you click a third party link, you will be directed to that third party&amp;#39;s site. We strongly advise you to review the Privacy Policy of every site you visit.&lt;/p&gt;&lt;p style=&quot;margin-top:41px;margin-right:17px;margin-bottom: 0;margin-left:8px;margin-bottom:0&quot;&gt;We have no control over and assume no responsibility for the content, privacy policies or practices of any third party sites or services.&lt;/p&gt;&lt;p style=&quot;margin-top:0;margin-right:0;margin-bottom: 0;margin-left:0;margin-bottom:0&quot;&gt;&lt;span style=&quot;font-size: 43px&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;Children&amp;#39;s&amp;nbsp;&amp;nbsp;&amp;nbsp; Privacy&lt;/p&gt;&lt;p style=&quot;margin-top:50px;margin-right:131px;margin-bottom: 0;margin-left:8px;margin-bottom:0&quot;&gt;Our Service does not address anyone under the age of 18 (&amp;quot;Children&amp;quot;).&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:15px;font-family:&amp;#39;DejaVu Sans&amp;#39;,&amp;#39;sans-serif&amp;#39;&quot;&gt;&lt;br clear=&quot;all&quot; style=&quot;page-break-before:always&quot;/&gt; &lt;/span&gt; &amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-right:18px&quot;&gt;We do not knowingly collect personally identifiable information from anyone under the age of 18. If you are a parent or guardian and you are aware that your Child has provided us with Personal Data, please contact us. If we become aware that we have collected Personal Data from children without verification of parental consent, we take steps to remove that information from our servers.&lt;/p&gt;&lt;p style=&quot;margin-top:0;margin-right:0;margin-bottom: 0;margin-left:0;margin-bottom:0&quot;&gt;&lt;span style=&quot;font-size: 44px&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-right:182px&quot;&gt;Changes&amp;nbsp;&amp;nbsp; to&amp;nbsp; This Privacy Policy&lt;/p&gt;&lt;p style=&quot;margin-top:50px;margin-right:29px;margin-bottom: 0;margin-left:8px;margin-bottom:0&quot;&gt;We may update our Privacy Policy from time to time. We will notify you of any changes by posting the new Privacy Policy on this page.&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:15px;font-family:&amp;#39;DejaVu Sans&amp;#39;,&amp;#39;sans-serif&amp;#39;&quot;&gt;&lt;br clear=&quot;all&quot; style=&quot;page-break-before:always&quot;/&gt; &lt;/span&gt; &lt;/p&gt;&lt;p style=&quot;margin-right:17px&quot;&gt;We will let you know via email and/or a prominent notice on our Service, prior to the change becoming effective and update the &amp;quot;effective date&amp;quot; at the top of this Privacy Policy.&lt;/p&gt;&lt;p style=&quot;margin-top:41px;margin-right:39px;margin-bottom: 0;margin-left:8px;margin-bottom:0&quot;&gt;You are advised to review this Privacy Policy periodically for any changes. Changes to this Privacy Policy are effective when they are posted on this page.&lt;/p&gt;&lt;p style=&quot;margin-top:0;margin-right:0;margin-bottom: 0;margin-left:0;margin-bottom:0&quot;&gt;&lt;span style=&quot;font-size: 43px&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;Contact Us&lt;/p&gt;&lt;p style=&quot;margin-top:50px;margin-right:42px;margin-bottom: 0;margin-left:8px;margin-bottom:0&quot;&gt;If you have any questions about this Privacy Policy, please contact us:&lt;/p&gt;&lt;p style=&quot;margin-top:40px;margin-right:206px;margin-bottom: 0;margin-left:38px;margin-bottom:0&quot;&gt;&lt;span style=&quot;;position: absolute;z-index:29;left:0px;margin-left:47px;margin-top:59px;width:13px;height:13px&quot;&gt;&lt;img width=&quot;13&quot; height=&quot;13&quot; src=&quot;http://weituoceshi2019.cl687.4everdns.com/Public/lib/ueditor/1.4.3/themes/default/images/spacer.gif&quot; word_img=&quot;file:///C:/Users/ADMINI~1/AppData/Local/Temp/msohtmlclip1/01/clip_image015.gif&quot; style=&quot;background:url(http://weituoceshi2019.cl687.4everdns.com/Public/lib/ueditor/1.4.3/themes/default/images/word.gif) no-repeat center center;border:1px solid #ddd&quot;/&gt;&lt;/span&gt;By email:&lt;a href=&quot;mailto:questions@meetba.com&quot;&gt;&lt;span style=&quot;color:windowtext;text-underline:none&quot;&gt; questions@meetba.com&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', 1556617496, '隐私保护指引');
